import pandas as pd
import json

# Subtask 1: Load and clean the data from each beach's CSV file
def load_and_clean_data(file_path):
    df = pd.read_csv(file_path, skiprows=2)
    df.columns = df.columns.str.replace('Unnamed: \d+', '', regex=True).str.strip()
    df = df.dropna(how='all', axis=1)
    df = df.dropna(how='all')
    df['Date'] = pd.to_datetime(df['Date'], errors='coerce')
    for col in df.columns:
        if col not in ['Date']:
            df[col] = pd.to_numeric(df[col], errors='coerce')
    return df

beaches = {
    'Constitution Beach': 'constitution_beach_datasheet.csv',
    'Carson Beach': 'carson_beach_datasheet.csv',
    'Pleasure Bay Beach': 'pleasure_bay_and_castle_island_beach_datasheet.csv',
    'M Street Beach': 'm_street_beach_datasheet.csv',
    'City Point Beach': 'city_point_beach_datasheet.csv',
    'Malibu Beach': 'malibu_beach_datasheet.csv',
    'Tenean Beach': 'tenean_beach_datasheet.csv',
    'Wollaston Beach': 'wollaston_beach_datasheet.csv'
}

cleaned_data = {beach: load_and_clean_data(file) for beach, file in beaches.items()}

# Subtask 2: Identify the number of samples that failed to meet the swimming standards for each beach when there was no rainfall in the preceding three days
def count_failed_samples(df):
    failed_samples = 0
    for col in df.columns:
        if col not in ['Date', '1-Day Rain', '2-Day Rain', '3-Day Rain']:
            failed_samples += ((df[col] >= 104) & (df['3-Day Rain'] == 0)).sum()
    return failed_samples

failed_samples_count = {beach: count_failed_samples(df) for beach, df in cleaned_data.items()}

# Subtask 3: Determine which beach had the highest number of failed samples under the specified conditions
beach_with_highest_failures = max(failed_samples_count, key=failed_samples_count.get)

# Print the answers
print(json.dumps(
    {
        "subtask-1": "Data loaded and cleaned for all beaches.",
        "subtask-2": failed_samples_count,
        "main-task": beach_with_highest_failures
    }, indent=4
))
